    def test_blackbox_fuzz_individual(self):
        seeds = list(range(1,101))

        for _seed in seeds:
            args = Namespace(config='../../conf/experiment_conf', individual_mode=True, outfilename=None, seed=_seed, seedfile=None, testing_mode=True, verbose=False)
            fuzzer = Fuzzer(args)
            output = fuzzer.blackbox_fuzz_individual(filename=args.seedfile, seeds=[args.seed])
            output = [item for item in output if item][0]
            output = output[list(output.keys())[0]]
            output = output[list(output.keys())[0]]
            self.assertEqual(output, self.outputs[_seed])

